import React, { Component } from 'react';




class NewUser extends Component {
    constructor() {
        super();
        this.state = {

        };
    }


    render() {


        return (

            <div style={{}} className="container-fluid">
                <Switch>
                    {/* <Route path="/home" render={() => this.state.loggedIn ? <Home /> : <Redirect to='/login' />} /> */}
                    <PropsRoute exact path='/' component={SecuredLogin} changeUser={this.props.changeUser} />
                    <PropsRoute path="/login" component={SecuredLogin} changeUser={this.props.changeUser} />
                    <Route path="/home" component={SecuredHome} />
                    <Route path="/newOrder" component={SecuredNeworder} />
                    <Route path="/newUser" component={SecuredNewUser} />
                    <Route path='/' component={NotFound} pt='186px' pb='185px' class={'sol-sm-12'} />
                </Switch>
            </div>

        )
    }
}


export default Content
